    },
    {
        id: 'RoleID',
        numeric: true,
        disablePadding: false,
        label: 'Role',
        visible: true
    },
];
 
  return (
    <Card>
     
          <Divider />
          <DataTable columns={columns} />
      </Card>

  );
};

